import React, { useState } from 'react';
import Navbar from '../components/Navbar';

function NewEntryPage() {
  const [form, setForm] = useState({
    registration_number: '',
    asset_type: '',
    asset: '',
    bank: '',
    serial: '',
    date: '',
    timestamp: '',
    borrower: '',
    engine: '',
    chassis: '',
    mileage: '',
    condition: '',
    description: ''
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSave = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');
    try {
      const token = localStorage.getItem('token');
      const response = await fetch('http://localhost:5000/api/vehicles', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${token}`
        },
        body: JSON.stringify(form)
      });
      if (response.ok) {
        setSuccess('Entry saved successfully!');
        setForm({
          registration_number: '',
          asset_type: '',
          asset: '',
          bank: '',
          serial: '',
          date: '',
          timestamp: '',
          borrower: '',
          engine: '',
          chassis: '',
          mileage: '',
          condition: '',
          description: ''
        });
      } else {
        const data = await response.json();
        setError(data.message || 'Failed to save entry');
      }
    } catch (err) {
      setError('Network error');
    }
  };

  return (
    <>
      <Navbar showProfile={true} />
      <form onSubmit={handleSave}>
        <div className="form-section">
          <h3>General information of Asset</h3>
          <label>
            Registration Number:
            <input
              type="text"
              name="registration_number"
              value={form.registration_number}
              onChange={handleChange}
            />
          </label>
          <label>
            Type:
            <input
              type="text"
              name="asset_type"
              value={form.asset_type}
              onChange={handleChange}
            />
          </label>
          <label>
            Asset:
            <input
              type="text"
              name="asset"
              value={form.asset}
              onChange={handleChange}
            />
          </label>
          <label>
            Bank:
            <input
              type="text"
              name="bank"
              value={form.bank}
              onChange={handleChange}
            />
          </label>
          <label>
            Serial:
            <input
              type="text"
              name="serial"
              value={form.serial}
              onChange={handleChange}
            />
          </label>
          <label>
            Date:
            <input
              type="date"
              name="date"
              value={form.date}
              onChange={handleChange}
            />
          </label>
          <label>
            Timestamp:
            <input
              type="text"
              name="timestamp"
              value={form.timestamp}
              onChange={handleChange}
            />
          </label>
          <label>
            Borrower:
            <input
              type="text"
              name="borrower"
              value={form.borrower}
              onChange={handleChange}
            />
          </label>
          <label>
            Engine:
            <input
              type="text"
              name="engine"
              value={form.engine}
              onChange={handleChange}
            />
          </label>
          <label>
            Chassis:
            <input
              type="text"
              name="chassis"
              value={form.chassis}
              onChange={handleChange}
            />
          </label>
          <label>
            Mileage:
            <input
              type="text"
              name="mileage"
              value={form.mileage}
              onChange={handleChange}
            />
          </label>
          <label>
            Condition:
            <input
              type="text"
              name="condition"
              value={form.condition}
              onChange={handleChange}
            />
          </label>
          <label>
            Description:
            <textarea
              name="description"
              value={form.description}
              onChange={handleChange}
            />
          </label>
        </div>
        <div className="form-section">
          <h3>Inventory of the asset</h3>
          {/* Render fields based on asset type (2/3/4 wheeler) */}
        </div>
        <div style={{ width: '100%', display: 'flex', gap: '1rem', flexWrap: 'wrap' }}>
          <button type="submit">Save</button>
          <button type="button" onClick={handleCancel}>
            Cancel
          </button>
        </div>
        {error && <div style={{ color: 'red' }}>{error}</div>}
        {success && <div style={{ color: 'green' }}>{success}</div>}
      </form>
    </>
  );
}

export default NewEntryPage;
